import React from 'react';
import ReactDOM from 'react-dom/client';
import App from './App';
import { gql,NormalizedCacheObject, ApolloClient, InMemoryCache, ApolloProvider, HttpLink } from '@apollo/client';
import reportWebVitals from './reportWebVitals';
import {BrowserRouter } from 'react-router-dom';




//a terminating link that sends a GraphQL operation to a remote endpoint over HTTP
const httpLink = new HttpLink({
  uri: 'http://localhost:5000/graphql',
  fetchOptions: {
    mode: 'no-cors',
  },
});

// const client = new ApolloClient({

//   cache: new InMemoryCache(),
//   link: httpLink,
// });
export const client: ApolloClient<NormalizedCacheObject> = new ApolloClient({
  cache: new InMemoryCache(),
  link: httpLink,
});


const root = ReactDOM.createRoot(document.getElementById('root')!);
root.render(
  // apolloprivider wraps react app and allows you to access queries from anywhere in app
  // <BrowserRouter forceRefresh={true}> 
  <BrowserRouter forceRefresh={true}> 
  <ApolloProvider client={client}>
    <React.StrictMode>
      <App />
    </React.StrictMode>
  </ApolloProvider>
  </BrowserRouter>
);

